import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';


class App extends Component {
  constructor() {
    super();
    this.state = {
      title:'Simple Country',
      countries: []
    }
  }
  render() {
    return (
      <div className="App">
        <h1> hello mama </h1>
      <p> how about this </p>
      </div>
    );
  }
}

export default App;
